import { CHANGE_YOUTUBE_URL } from './url-constant.js';

const initialState = {
	youtube_url: '',
}

const change_ytURL_reducer = (state=initialState, action) => {
	switch(action.type) {
		case CHANGE_YOUTUBE_URL:
			return Object.assign({}, state, {youtube_url: action.payload.youtube_url});
		default:
			return state
	}
}

export default change_ytURL_reducer;
